import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className='App'>
      <div className='Upper_block'>First block</div>
      <div className='Lower_block'>
        Second block
        <ul>
          <li>HTML</li>
          <li>CSS</li>
          <li>JavaScript</li>
        </ul>
      </div>
    </div>
  );

  const Header = () => {
    <div>
      <a>News</a>
      <a>Menu</a>
      <a>Messages</a>
      <a>Settings</a>
    </div>
  }
}

export default App;
